import React from "react";
import MainTemplate from "../../components/MainTemplate/MainTemplate";
import Home from "../Home/Home";
import { BrowserRouter, Route, Switch} from 'react-router-dom';
import Pokedex from "../Pokedex/Pokedex";
import Info from "../Info/Info";
import PokemonDetail from "../PokemonDetail/PokemonDetail";
import Logo from "../../assets/Images/logo.png";

function App() {

    const nav = [
        {url: "/", text : "Home", exact : true},
        {url: "/pokedex", text:"Pokedex", exact:false },
        {url: "/info", text:"info", exact: true}
    ];

    return (
        <BrowserRouter>
            <MainTemplate
                footerCourseName="Tecnologie e Applicazioni dnei sistemi distribuiti"
                footerCourseLink="https://elearning.unimib.it/course/view.php?id=37789"
                navItems={nav}
                logo={Logo}
                >
                <Switch>
                    <Route exact path="/" component={Home}/>
                    <Route exact path="/pokedex" component={Pokedex}/>
                    <Route exact path="/info" component={Info}/>
                    <Route exact path="/pokedex/:number" component={PokemonDetail}/>
                </Switch>
         </MainTemplate>
        </BrowserRouter>
    )
}

export default App;
